import React, { Component } from 'react';
import User from './pages/UserInput';
// import logo from './logo.svg';


class App extends Component {
  constructor(props){
    super(props);
    this.state = {
      nameFirst: '',
      nameLast:'',
      nameAddress:'',
      nameCity:'',
      nameState:'',
      nameZipcode:'',
      nameEmail:'',
      }
      this.handleChange = this.handleChange.bind(this)
  }

  handleChange(event) {
    const target = event.target;
    const name = target.name;
    this.setState(target.value)
  }
  render() {
    const nameFirst = this.state.nameFirst;
    return (
      <div>
        <User nameFirst={nameFirst} ononChangeInput={this.handleChange} />

      </div>
    );
  }
}

export default App;
